import React, { useState } from "react"
import { Card, Button, Alert } from "react-bootstrap"
import { useAuth } from "../contexts/AuthContext"
import { useNavigate } from "react-router-dom"
import Navbar from "./Navbar"
import Sidebar from "./Sidebar"
import Home from "./pages/H"


export default function Dashboard() {
  const [error, setError] = useState("")
  const { currentUser } = useAuth()
  const navigate = useNavigate();

  return (
    <>
      <Navbar />
      <Sidebar />
      <Router>
          <AuthProvider>
            <Routes >
                        <Route
                            exact="true"
                            caseSensitive={false}
                            path="/"
                            element={
                            <PrivateRoute>
                                <Home />
                            </PrivateRoute>
                            }
                        />
                        <Route
                            caseSensitive={false}
                            path="/home"
                            element={
                            <PrivateRoute>
                                <Home />
                            </PrivateRoute>
                            }
                        />
                        <Route
                            caseSensitive={false}
                            path="/summarizer"
                            element={
                            <PrivateRoute>
                                <Summarizer />
                            </PrivateRoute>
                            }
                        />
                        <Route
                           caseSensitive={false}
                            path="/predict"
                            element={
                            <PrivateRoute>
                                <Predict />
                            </PrivateRoute>
                            }
                        />
            </Routes>
          </AuthProvider>
        </Router>
    </>
  )
}
